import Leagues from './components/Leagues'
import Navbar from "./components/Navbar";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import {useState} from "react";
import Schedule from "./components/Schedule";
import styles from "./index.css"

const API_URL = "http://localhost:8080/api/lol"
const App = () => {
    const [leagueId, setLeagueId] = useState("")

    function handleOnClick(league){
        console.log("seatLeagueId: " + league.id)
        setLeagueId(league.id)
    }

    return (
        <div>
        <BrowserRouter>
            <Navbar/>
            <Leagues url={API_URL} onClick={handleOnClick}/>}
            <Routes>
                <Route path="/" element={<Schedule url={API_URL} leagueId={leagueId}/>}/>
            </Routes>
        </BrowserRouter>
        </div>
  );
}

export default App;
